class NzDemoTableGroupingColumnsComponent {
    constructor() {
        this.widthConfig = ['100px', '200px', '200px', '100px', '100px', '200px', '200px', '100px'];
        this.scrollConfig = { x: '1200px', y: '240px' };
        this.listOfDisplayData = [];
        this.listOfData = [];
        this.sortValue = null;
        this.filterName = [{ text: 'Joe', value: 'Joe' }, { text: 'John', value: 'John' }];
        this.searchName = [];
    }
    search(searchName) {
        this.searchName = searchName;
        const filterFunc = (item) => {
            return this.searchName.length ? this.searchName.some(name => item.name.indexOf(name) !== -1) : true;
        };
        const listOfData = this.listOfData.filter(item => filterFunc(item));
        this.listOfDisplayData = listOfData.sort((a, b) => this.sortValue === 'ascend' ? (a.age > b.age ? 1 : -1) : b.age > a.age ? 1 : -1);
    }
    ngOnInit() {
        for (let i = 0; i < 100; i++) {
            this.listOfData.push({
                name: 'John Brown',
                age: i + 1,
                street: 'Lake Park',
                building: 'C',
                number: 2035,
                companyAddress: 'Lake Street 42',
                companyName: 'SoftLake Co',
                gender: 'M'
            });
        }
        this.listOfDisplayData = [...this.listOfData];
    }
}


